VALUES ('5201216320011', 'Aceto Balsamico', 'Xenia Aceto BALSAMICO DI MODENA IGP NPOTATEYOMENH ΓΕΩΓΡΑΦIΚΗ ΕΝΔΕΞΗ EYAI BAAZAMIKO TH MODENA To Eúoi Aceto Balsamico di Modena IGP, είναι ένα εξαιρετικό άρτυμα για να δσετε πλούσια γεύση στο κρέας, στο ψάρι. και σε όλα τα λαχανικά. To Euot Aceto Balsamico di Modena IGP, παράγεται στη Μodena, περιοχή της Ιταλίας, με τον κλασικό τρόπο που τόσο καλά γιωρίζουν οι κάτοικοί της. \' ΣΥΣΤΑΤΙΚΑ: Εδι από κρασί (ξίδι. αντιοξειδωτικό. διοξείδιο του θείου), συμπυκνωμένος μούστος, καραμελόχρωμα: 150d Περιέχει θειδη. INGREDIENTS: Wine vinegar (wine. adioxidant: sulphur dioxide), concentrated grape must, caramel color 150d Contains Sulphites Prodotto netla provincia di Modena Sito di imbottigliamento: n CSQA216311 Certificato da Organismo di Controllo autorizzato da Ministero delle Politiche Agricole, Alimentari e Forestali. 0 YTHTA ACIDITY 6% ΕΜΦΑΝΙΣΗ ΖΗΜΑΤΟΣ ΣΤΟ ΚΑΤΩ ΜΕΡΟΣ ΤΗΣ ΦΙΑΛΗΣ EINAI OYZIOAOFIKH THE APPEARANCE OF RESIDUE AT THE BOTTOM OF THE BOTTLE IS NATURAL 250MLe OAYMNIA-XENIA ABAE AMAAIAAA HAEIAS, THA: 26220 92 303 OLYMPIA-XENIA ASA AMALIADA ILIAS, GREECE, TEL: +30 26220 92 303 www.olympia-oliveoil.com e-mail: olympiaoil@otenet.gr', 'https://static.openfoodfacts.org/images/products/520/121/632/0011/front_en.4.400.jpg', '', '', '', '', '', '', '', '', '', '1');

