VALUES ('5201228234153', 'Λεμονόπιτα Trendy', 'Αλεύρι σίτου (γλουτένη), γέμιση λεμόνι 30% [φρούτα 45%, ζάχαρη, σιρόπι γλυκόζης– φρουκτόζης, νερό, πηκτικό μέσο (πηκτίνη), φυσικός χυμός λεμονιού 1%, μέσο οξίνισης (κιτρικό ασβέστιο, κιτρικό οξύ), συντηρητικό (σορβικό κάλιο), αρωματικές ύλες, χρωστικές (β-καροτένιο, ριβοφλαβίνη)], μαργαρίνη [φοινικέλαιο, κοκόλιπος, μερικώς υδρογονωμένα φυτικά λιπαρά (φοινικέλαιο, κοκόλιπος, ηλιέλαιο, βαμβακέλαιο), νερό, αλάτι, γαλ/της (μονο - και διγλυκερίδια λιπαρών οξέων), ρυθμιστής οξύτητας (κιτρικό οξύ), χρωστική (β-καροτένιο), συντηρητικό (σορβικό κάλιο)], ζάχαρη, άμυλο αραβοσίτου, σιρόπι γλυκόζης,  αποβουτυρωμένο γάλα σκόνη, κρόκος αυγού σκόνη, σταθεροποιητής (γλυκερίνη, σιρόπι σορβιτόλης), διογκωτικοί  παράγοντες (πυροφωσφορικό άλας νατρίου, όξινο ανθρακικό νάτριο, ανθρακικό ασβέστιο), αλάτι, αρωματικές ύλες,  συντηρητικό (σορβικό κάλιο).', 'https://static.openfoodfacts.org/images/products/520/122/823/4153/front_el.4.400.jpg', '', '', '', '', '', '', '', '', '', '1');

